import React from 'react';


const style_block = {
  display: 'block',
}

const style_inline = {
  display: 'inline-block',
}


const Inputs_left = () => {

  return (<div style={style_block}>
    <label for="First_Name">First Name:</label>
    <input name="first_name" id="First_Name" type="text" ></input>
    <label for="Name">Last Name:</label>
    <input name="last_name" id="Last_Name" type="text" ></input>
    {/*   <p>Імʼя</p> */}
    {/*   <input></input> */}

    {/*   <p>Фамілія</p> */}
    {/*   <input></input> */}

    {/* </div> */}

    <p>Назва компанії, організації</p>
    <input></input>

    <p>Email адрес</p>
    <input></input>

    <p>Номер телефону</p>
    <input></input>
  </div>
  );

}

export default Inputs_left;
